import React from 'react';
import './Navbar.css'; // Assuming you'll style it using CSS
import { Link } from 'react-router-dom';
import About from './About';

const Navbar = () => {
  return (
    <nav className="navbar">
      <div className="logo">
        <a href="/">August AI</a>
      </div>
      <ul className="nav-links">
        <Link to={About} pa/>
      </ul>
    </nav>
  );
};

export default Navbar;
